import '../styles/Navbar.css';
import squealerLogo from '../img/squealerLogo.svg'

function Navbar() {
    return (
        <div className='container-fluid bg-black'>
            <div className='row'>
                <div className='col-2'>
                    <img src={squealerLogo} id='navbar-logo'></img>
                </div>
                <div className='col-5'>
                    <ul>
                        <li>Home</li>
                    </ul>
                </div>
                <div className='col-3'></div>
            </div>
        </div>
    );
}

export default Navbar;
